import React from "react";

const UserList = ({ userList = [] }) => {
  return (
    <>
      {userList.map((data, index) => {
        if (data) {
          return (
            <div key={data.name}>
              <h6>{data.name}</h6>
            </div>
          );
        }
        return null;
      })}
    </>
  );
};

export default UserList;
